    <div>
      <h1>Welcome To Pizza Planet</h1>
      <h2>Please select your role</h2>
      <ul>
      <Link to="/owner">
        <button className="buttons">Shop Owner</button>
        </Link>
        <br>
        </br>
        <br>
        </br>
      <Link to="/chef">
        <button>Pizza Chef</button>
        </Link>
      </ul>
    </div>
  )
}
